function getCountriesList() {
    fetch('https://restcountries.com/v3.1/all?fields=name,capital')
        .then((response) => response.json())
        .then((data) => {
            console.log(data);
        })
        .catch((err) => {
            console.log(err.message);
        })
    }

export default getCountriesList;
